import React from 'react';
import styled from 'styled-components';
import { Title } from '../styled/theme';
const Main = styled.div`
	display: flex;
    margin-top: 5vh;
	background-color: blue;

`;

const RecentImgs = () => {
	return(
		<Main className="main">
			<Title>Recent Stories</Title>
		</Main> 
	);
};

export default RecentImgs;
